import './cards.css'
import {CardsData } from '../Data/Data'
import { Card } from '@material-ui/core'


const Cards = () => {
  return (
    <div className="Cards">
        {CardsData.map((card, id) => {
            return(
                <div className="parentContainer">
                    hello
                    {/* <Card
                        icon={card.icon}
                        count={card.count}
                        title={card.title}
                        trendIcon={card.trendIcon}
                        per={card.per}
                    /> */}
                </div>
            )
        })}
    </div>
  )
}

export default Cards
